import React from "react";
import styled from "styled-components";

const DivLog  = styled.div`
    border      : 1px;
    padding     : 5px;
`;

const Log = () => {
    return (
        <DivLog className={"card"}>
            <label>Username :</label>
            <input type={"text"}/>
        </DivLog>
    );
};

export default Log;
